import React, { Component } from 'react'

class SuccessfulRegistrationPage extends Component{
    render() {
        return (
            <div>
                <h1>Registered succesfully</h1>
                <h3>A verification email has been sent to the provided email. Please follow the instruction to complete your registration process.</h3>
                <div> You will automatically redirected to Log In page in 5 seconds.</div>
                <div> If not, please click here</div>
            </div>
        )
    }
}

export default SuccessfulRegistrationPage
